import styled from 'styled-components'
import colors from '../../utils/style/colors'

const TagGy = styled.span`
  background-color: ${colors.primary};
  border-radius: 1àpx;
  color: #ffffff;
  display: inline-block;
  font-size: 14px;
  margin: auto 10px;
  min-width: 115px;
  padding: 5px 15px;
  text-align: center;
`
function Tag({ name }) {
  return <TagGy>{name}</TagGy>
}

export default Tag
